import React from 'react'
import styled from 'styled-components'

function SideBar() {
  return (
    <Container>
        <nav>
            <ul>
                <li>Health & Beauty</li>
            </ul>
        </nav>
    </Container>
  )
}

const Container=styled.div`
    width:100%;
    height:60px;
    background-color:#fff;
    display:flex;
    align-items:center;
    position:relative;
    flex:0.3;
`;
export default SideBar
